import React from "react";
import Common from "./Common";

const Home = () => {
  return (
    <>
      <Common
        title="Grow Your Business with"
        brand_name="React"
        subtitle="We are the team of talented developer making websites"
        link_content="Get Started"
      />
    </>
  );
};

export default Home;
